import React from 'react'
import CIcon from '@coreui/icons-react'
import {
  cilBell,
  cilCalculator,
  cilCalendar,
  cilChartLine,
  cilChartPie,
  cilCursor,
  cilDrop,
  cilNotes,
  cilPencil,
  cilPeople,
  cilPuzzle,
  cilSpeedometer,
  cilStar,
} from '@coreui/icons'
import { CNavGroup, CNavItem, CNavTitle } from '@coreui/react'

const _nav = [
  {
    component: CNavItem,
    name: 'Youtube',
    to: '/dashboard',
    icon: <CIcon icon={cilSpeedometer} customClassName="nav-icon" />,
  },
  {
    component: CNavGroup,
    name: 'Accounting',
    icon: <CIcon icon={cilCalculator} customClassName="nav-icon" />,
    items: [
      {
        component: CNavItem,
        name: 'Insert',
        to: '/login',
        icon: <CIcon icon={cilPen} customClassName="nav-icon" />,
      },
      {
        component: CNavItem,
        name: 'Edit',
        to: '/register',
      },
      {
        component: CNavItem,
        name: 'Fetch',
        to: '/404',
      },
    ],
  },
  {
    component: CNavGroup,
    name: 'Attendance',
    icon: <CIcon icon={cilCalendar} customClassName="nav-icon" />,
    items: [
      {
        component: CNavItem,
        name: 'Insert',
        to: '/login',
      },
      {
        component: CNavItem,
        name: 'Edit',
        to: '/register',
      },
      {
        component: CNavItem,
        name: 'Fetch',
        to: '/404',
      },
    ],
  },
  {
    component: CNavGroup,
    name: 'Member',
    icon: <CIcon icon={cilPeople} customClassName="nav-icon" />,
    items: [
      {
        component: CNavItem,
        name: 'Insert',
        to: '/login',
      },
      {
        component: CNavItem,
        name: 'Edit',
        to: '/register',
      },
      {
        component: CNavItem,
        name: 'Fetch',
        to: '/404',
      },
    ],
  },
]

export default _nav
